{   
  "openapi": "3.0.0",
    "info": {
        "title": "Nest user API",
        "description": "User API built in NestJS for study",
        "version": "0.1",
        "contact": {
            "email": "rodrigomendoncca@gmail.com",
            "name": "Rod Cordeiro"
        }
    },
    "tags": [
        {
            "name": "User",
            "description": "User endpoints requests"
        }

    ],
    "servers": [
        {
            "url": "http://localhost:3333",
            "description": "Development server"
        },
        {
            "url": "https://nestuserapi.herokuapp.com/",
            "description": "Homologation server"
        }
    ],
    "paths": {
      "/":{
        "get":{
          "summary": "Validates API Health",
          "responses": {
            "200": {
            "description": "Success. Returns API version",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "version": {
                       "type": "string"
                      }
                    }
                  }
                }
              }
            },
            "400": {
              "description": "Errors occured during request"
            }
          }
        }
      },
      "/users": {
        "get": {
          "tags": [
          "User"
          ],
          "summary": "List all users",
          "responses": {
            "200": {
            "description": "Returns a list of users",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "version": {
                       "type": "string"
                      }
                    }
                  }
                }
              }
            },
            "400": {
            "description": "Errors ocurred while validating API"

            }
          }
        }
      },
      "/users/{id}": {
        "get": {
          "tags": [
          "User"
          ],
          "summary": "List one user by id",
          "parameters": [{
            "name": "id",
            "in": "path",
            "required": true,
            "schema": {
              "type": "string"
            }
          }],
          "responses": {
            "200": {
            "description": "Returns a list of users",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "version": {
                       "type": "string"
                      }
                    }
                  }
                }
              }
            },
            "400": {
            "description": "Errors ocurred while validating API"

            }
          }
        }
      },
    }

}
